import React, { Component } from 'react';
import '../Projects.css'
import {Doughnut} from 'react-chartjs-2';
import Navbar from '../Components/Navbar'
import ReactVivus from 'react-vivus';
import rectangle from '../SVG/rectangle.svg'


const data={
  labels: ["JavaScript", "Python", "Ruby"],
  datasets: [
    {
      label: "My Skills",
      backgroundColor: ["rgb(255, 99, 132)","rgb(54, 162, 235)","rgb(255, 205, 86)"],
      borderColor: 'white',
      data: [50, 50, 50],
  }]
}

class Profile extends Component {
  render() {
    return (
      <div style={{"width":"100%","height":"100vh","backgroundColor":"#33466b"}}>



        {/* <div style={{"width":"100%","height":"100%","position":"absolute"}}>
          <div className="skew"></div>
          <div className="skew2"></div>
        </div>*/}

        <div style={{"display":"flex"}} uk-scrollspy="cls: uk-animation-slide-left-small; target: > div > .uk-card; delay: 500; repeat: true">
          <div style={{"width":"50%","height":"100vh","marginLeft":"100px"}}>
            <div class="uk-card uk-card-default uk-card-body" style={{"position":"absolute","width":"410px","height":"100%","backgroundColor":"#84a3ff"}}></div>
            <div
              style={{"position":"absolute","background":"rgba(0,0,0,0)","box-shadow":"0 0px 0px rgba(0,0,0,0)"}}
              class="uk-card uk-card-default uk-card-body"
            >
                <img src="pictures/me2.jpg" width="90px" height="90%" alt="" uk-img/>
            </div>
          </div>
          <div style={{"height":"400px","width":"35%","marginTop":"100px","textAlign":"center"}}>

            <div class="uk-card uk-card-default uk-card-body">
                <h3 class="uk-card-title">Brian Yu</h3>
                <p>I'm a developer fascinated with all things design and UX.</p>
                <p>I was previously a Co-Founder of a contracting company in the Bay Area,
                as well as Project Manager in Finance. In each of these roles I've always found knack
                and appreciation for design, which is what eventually brought me here: building apps -
                like building building a different type of 'house' with different 'tools.'</p>

                <p>Outside of coding my interests include: Culinary, Design, Architecture</p>
          </div>

        </div>
      </div>
    </div>
    );
  }
}

export default Profile;
